import Profile from "./Profile/Profile";
import { GlobalStyle } from "GlobalStyle";

import user from "../../src/user.json";
import Layout from "./Layout/Layout";
const { username, tag, location, avatar, stats } = user;

function App() {
  return (
    <Layout>
      <Profile
        username={username}
        tag={tag}
        location={location}
        avatar={avatar}
        stats={stats}
      />
      <GlobalStyle />
    </Layout>
  );
}

export default App;
